Windows allows the creation of file names and folder names that can not be deleted or renamed via Windows Explorer.
This includes names with invalid characters and names that are too long.
Some windows functions allow creation of folder paths such that the combined path + filename lengths exceed the maximum permitted length.
The current limit is 260 characters.
In other words, windows can create names that are too long for the standard Windows Explorer to delete.
The scan function also attempts to identify file and folder names with invalid characters which would make them un-removable via Windows Explorer.
